const formatDataOriginal = (dataSource, parentId) => {
  const data = dataSource.map((item, index) => {
    const  {itemName,typesUnderConstructionName,construction_siteName,consContent,itemStartYear,itemAmt,planAmtAll,respDeptName, children} = item ;
    let newChildren = undefined;
    if(children && children.length) {
      newChildren = formatDataOriginal(children, index);
    }
    return {
      id: `${parentId}+${index}`,
      ...item,
      children: newChildren
    }
  });
  return data;
}

const formatData = (dataSource, parentId) => {
  const data = dataSource.map((item, index) => {
    const  {itemName,typesUnderConstructionName,construction_siteName,consContent,itemStartYear,itemAmt,planAmtAll,respDeptName, children} = item ;
    let newChildren = undefined;
    if(children && children.length) {
      newChildren = formatData(children, index);
    }
    return {
      id: `${parentId}+${index}`,
      itemName,typesUnderConstructionName,construction_siteName,consContent,itemStartYear,itemAmt,planAmtAll,respDeptName,
      children: newChildren
    }
  });
  return data;
}

